import React from 'react';
import {
  Dialog,
  DialogTitle
} from '@material-ui/core';

export default function FormDialog(props){
  const handleClose = () => {
    props.toggleFormDialog();
  };

  return(
    <Dialog open={props.formDialogState} onClose={handleClose}>
      <DialogTitle>Hello world!</DialogTitle>
    </Dialog>
  );
}
